        fetch('http://api.openweathermap.org/data/2.5/onecall/timemachine?lat='+lat+'&lon='+long+'&dt='+timestamp+'&appid=2a6ed6669671100313d8ccd388e8784e').then(async response => {
          const isJson = response
              .headers
